bool LbyUpdate()
{
	static float NextUpdate = 0;
	float Curtime = g_Interfaces->globalVars->curtime; //g_pGlobalVars->curtime; <--old   //Woodster451 Coded this
	auto AnimState = Globals::localPlayer->animState();

	if (!AnimState || !(Globals::localPlayer->flags() & FL_ONGROUND))
		return false;

	if (AnimState->speed_2d > 0.1f)
		NextUpdate = Curtime + 0.22f;

	if (NextUpdate < Curtime)
	{
		NextUpdate = Curtime + 1.1f;
		return true;
	}

	return false;
}

